// Swaps two int values 
void swap(int* a, int* b) {
	int temp;
	temp = *a;
	*a = *b;
	*b = temp;
}

// Returns absolute value of int
int abs(int a) {
	if (a < 0) {
		return -a;
	}
	return a;
}


//Sends the text to display 
void video_text(int x, int y, char* text_ptr) {
	int offset;
	volatile char* character_buffer = (char*)FPGA_CHAR_BASE;

	offset = (y << 7) + x;
	while (*text_ptr) {
		*(character_buffer + offset) = *(text_ptr);
		text_ptr++;
		offset++;
	}
}

